import './App.css';
import Navbar from "./components/Navbar";
import Home from "./pages/Home";
import {BrowserRouter as router, Route, Switch} from 'react-router-dom'

function App() {
  return (
    <div className="App">
      <Navbar />
      <Switch>
        <Route path="/" exact component={Home}/>
      </Switch>
    </div>
  );
}

export default App;
